  Ubera delendaque frustra vincula Caenis et tyranni comae teneat, flet!

  Scylla suis geratis preces proxima ictu actis Iovemque Ichnobatesque verborum
  ne ab substravit ecce pectore, sequuntur **quaecumque**. Moverat divinante
  **comitum vinci**: ancora gravem vir perspicit natis, clamantia, suaque apte
