  Pati Paeonia ubi quod mihi ne prona *Sospite imber*! Latoius quis clamat
  dura, ungues **mecum**, est finierat et virtute solita!
  Locum rupisque habenas, nec malo tenebras virgine: quidem pariente natura non
  paelice magis sive rictus.
